const HOST = "http://192.168.43.249/idlaps-timing/";
let displayBox = document.querySelector(".display");
let tableBody = document.querySelector("#tableBody");

// Show The answer to calculations
function showDisplay(event) {
  beep();
  const x = event.target.innerText;
  if (
    displayBox.innerHTML.length >= 5 ||
    (displayBox.innerHTML.length == 4 && x.length > 1)
  )
    return;

  if (displayBox.innerHTML == 0) {
    return (displayBox.innerHTML = x);
  }

  return (displayBox.innerHTML += x);
}

// Calculation answer
function calculate() {
  enterBeep();
  createData();
}

// Clear all calculations
function clearAllDisplay() {
  deleteBeep();
  displayBox.innerText = 0;
}

// Delete the last entry
function clearLast() {
  deleteBeep();
  let text = displayBox.innerText;
  if (text.length === 1) {
    displayBox.innerText = 0;
  } else {
    displayBox.innerText = text.substring(0, text.length - 1);
  }
}

function beep() {
  let snd = new Audio(
    "data:audio/wav;base64,"
  );
  snd.play();
}
function deleteBeep() {
  let snd = new Audio(
    "data:audio/mpeg;base64,"
  );
  snd.play();
}
function enterBeep() {
  let snd = new Audio(
    "data:audio/mpeg;base64,"
  );
  snd.play();
}

document.querySelector(".calculate").addEventListener("click", calculate);
document.querySelector(".clear-all").addEventListener("click", clearAllDisplay);
document.querySelector(".clear-last").addEventListener("click", clearLast);

let list = document.querySelectorAll("div.show-display");

list.forEach((item) => {
  item.addEventListener("click", showDisplay);
});

function createData() {
  const idBaris = getCounter();
  const bib = document.querySelector(".display").innerText;
  const time = getCurrentTime();
  let existingData = JSON.parse(localStorage.getItem("data")) || [];

  // Check if there is existing data with the same bib
  const existingItems = existingData.filter((item) => item.bib === bib);

  // Calculate lap based on the count of existing items with the same bib
  const lap = existingItems.length + 1;

  const newData = { idBaris, bib, time, lap };
  existingData.push(newData);

  localStorage.setItem("data", JSON.stringify(existingData));

  // Reload the table
  displayData();
  displayBox.innerText = 0;
}

function displayData() {
  const tableBody = document.getElementById("tableBody");
  tableBody.innerHTML = "";

  let data = JSON.parse(localStorage.getItem("data")) || [];
  data = data.reverse();
  data.forEach((item) => {
    const row = tableBody.insertRow();
    row.insertCell(0).textContent = item.idBaris;
    row.insertCell(1).textContent = item.bib;
    row.insertCell(2).textContent = item.time;
    row.insertCell(3).textContent = item.lap;

    const deleteButton = document.createElement("button");
    const editButton = document.createElement("button");
    const div = document.createElement("div");
    deleteButton.textContent = "❌";
    deleteButton.addEventListener("click", () => deleteData(item.idBaris));
    editButton.textContent = "✏";
    editButton.addEventListener("click", () => editData(item.idBaris));
    editButton.classList.add("me-3", "btn", "btn-sm", "btn-success");
    deleteButton.classList.add("btn", "btn-sm", "btn-danger");
    div.appendChild(editButton);
    div.appendChild(deleteButton);
    row.insertCell(4).appendChild(div);
  });
}

