function deleteData(idBaris) {
  let data = JSON.parse(localStorage.getItem("data")) || [];
  data = data.filter((item) => item.idBaris !== idBaris);
  localStorage.setItem("data", JSON.stringify(data));

  // Reload the table
  displayData();
}

function getCounter() {
  let counter = localStorage.getItem("counter") || 0;
  counter = parseInt(counter) + 1;
  localStorage.setItem("counter", counter);
  return counter;
}

function getCurrentTime() {
  const jakartaTime = new Intl.DateTimeFormat("en-US", {
    hour: "2-digit",
    minute: "2-digit",
    second: "2-digit",
    fractionalSecondDigits: 2,
    hour12: false, // Use 24-hour format
    timeZone: "Asia/Jakarta",
  }).format(new Date());

  return jakartaTime;
}

function groupByBib(bib) {
  let data = JSON.parse(localStorage.getItem("data")) || [];

  // Check if there are multiple occurrences of the same bib
  const bibOccurrences = data.filter((item) => item.bib === bib);

  // If there are multiple occurrences, set lap to the count of occurrences
  // Otherwise, set lap to 1
  const lap = bibOccurrences.length > 1 ? bibOccurrences.length : 1;

  return lap;
}

// Clear All
function clearAll() {
  localStorage.removeItem("data");
  localStorage.removeItem("counter");
  clearAllDisplay();

  // Reload the table
  displayData();
}

// Initial Load
displayData();

function sendToDB() {
  const localStorageData = localStorage.getItem("data") || [];
  let postData = new FormData();
  postData.append("result", localStorageData);
  fetch(HOST + "result", {
    method: "POST",
    body: postData,
  })
    .then((response) => response.json())
    .then((data) => {
      console.log(data);
      if (data.success) {
        alert("Data sent successfully!");
      } else {
        alert("Failed to send data. Please try again later.");
      }
    })
    .catch((error) => {
      console.error("Error sending data:", error);
      alert("An error occurred while sending data. Please try again later.");
    });
}
